import React , { Component }from 'react';
import './App.css';
import Map from './Components/Map'
class App extends Component {


  constructor(props){

    super(props);
    this.state = {
      pointer:{lat:30.741482,lng:76.768066},
    }

  }


  render(){
    const data = [
      {
        id: 1,
        name: "Sec 2",
        latlong:[30.764027, 76.791288],
        intensity:150
      },
      {
        id: 2,
        name: "Sec 3",
        latlong:[30.758054, 76.796017],
        intensity:120
      },
      {
        id: 2,
        name: "Sec 3",
        latlong:[30.758054, 76.796017],
        intensity:150
      },

    ];

    data[0].circle = {
      radius: 80,
      options: {
        strokeColor: '#FF0000',
        strokeOpacity: 0.15,
        strokeWeight: 2,
        fillColor: '#FF0000',
        fillOpacity: 0.15,
      }
    };
    return(
      <div className="App">
       <Map
    center={this.state.pointer}
    zoom={14}
    places={data}
    googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyBqqW5pq28Qera8ScOykfyKpiIP5Cc0XAM"
    loadingElement={<div style={{ height: `100%` }} />}
    containerElement={<div style={{ height: `100vh` }} />}
    mapElement={<div style={{ height: `100%` }} />}
  />, 
      </div>
    )
    }

}

export default App;
